import { Routes, Route } from "react-router-dom";
import { Home } from "./components/home/home";
import { Login } from "./components/login/login";
import { loginCheck } from "/home/albi/Documents/ReactProject/pet-shop/src/templateAPI/loginCheck.js";
import { SecureRoute } from "./util/secureRoute";

function App() {
  return (
    <Routes>
      <Route path="/check" element={<Login />} />   
      <Route path="/home" element={<SecureRoute Route = {<Home />} />} />
      <Route path="/login" element={<Login />} />
    </Routes>
  );
}

export default App;
